import {FETCH_NEWS} from "./news.types";

const INITIAL_STATE = {
  allNews: null
}
console.log(state)


const newsReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case FETCH_NEWS:
      return {
        ...state,
      }
    default:
      return state;
  }

}
export default newsReducer;
